import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import Dropzone from "react-dropzone";
import "dropzone/dist/dropzone.css";

const axios = require("axios");

function Dashboard() {
  // const myDropzone = new Dropzone("#my-form");
  // const output = document.querySelector("#output");

  if (document.getElementById("my-form")) {
    var myDropzone = new Dropzone("#my-form", { url: "/file/post" });
    // other code here
  }

  const navigate = useNavigate();

  
  useEffect(() => {
    const user_id = sessionStorage.getItem("user_id");
    const token = localStorage.getItem("token");
  }, []);

  return (
    <>
      <form>
        <div className="card radius-10 p-5">
          <h4>Image for Home</h4>
          <div className="form-group">
            <label for=""></label>
            <input
              type="file"
              className="form-control-file btn"
              name=""
              id=""
              placeholder=""
              aria-describedby="fileHelpId"
            />
            <small id="fileHelpId" className="form-text text-muted">
              Help text
            </small>
          </div>
        </div>
        <div className="card radius-10 p-5">
          <h4>Image for Playlist</h4>
          <div className="form-group">
            <label for=""></label>
            <input
              type="file"
              className="form-control-file btn"
              name=""
              id=""
              placeholder=""
              aria-describedby="fileHelpId"
            />
            <small id="fileHelpId" className="form-text text-muted">
              Help text
            </small>
          </div>
        </div>

        <button class="btn btn-dark float-end">
                Submit <span class="badge badge-secondary"></span>
        </button>
      </form>
    </>
  );
}

export default Dashboard;
